var $bm_rt;
var freq, decay, t, startVal, endVal, duration;
freq = effect('Frequency')('ADBE Slider Control-0001');
decay = effect('Decay')('ADBE Slider Control-0001');
if (effect('Random Time')('ADBE Checkbox Control-0001') == 0) {
    retard = mul(mul(textIndex, thisComp.frameDuration), effect('Offset')('ADBE Slider Control-0001'));
} else {
    seedRandom(mul(index, textIndex), timeless = true);
    retard = random(0, 1);
}
t = sub(time, sum(inPoint, retard));
startVal = [
    100,
    100,
    100
];
endVal = [
    0,
    0,
    0
];
$bm_rt = duration = effect('Duration')('ADBE Slider Control-0001');
if (t < duration) {
    $bm_rt = linear(t, 0, duration, startVal, endVal);
} else {
    amp = div(sub(endVal, startVal), duration);
    w = mul(mul(freq, Math.PI), 2);
    $bm_rt = sum(endVal, mul(amp, div(div(Math.sin(mul(sub(t, duration), w)), Math.exp(mul(decay, sub(t, duration)))), w)));
}

